import React from 'react';

class global extends react.Component {
    constructor(props) {
        super(props);

        this.state = {
            Annualbase: window.Annualbase,
            Annualbonus: window.Annualequity,
            Annualequity: window.Annualbonus,
            Annualperks: window.Annualperks,
        };
    };
}

export default global;
